import React from 'react';
import Login from './components/Login';

const App: React.FC = () => {
  return (
    <body>
      <div className="verticalCenter" style={{ height: '100vh' }}>
        <Login />
      </div>
      <section style={{ height: '30vh', textAlign: 'center' }}>
        <h1> Ludis</h1>
        <div className="info">
          <h3> About Ludis</h3>
          <p>
            Ludis is a platform built to connect people.
            Ludis is building a strong and vibrant community of athletes that brings
            you transparency, information, and knowledge of the platform's features.
          </p>
        </div>
      </section>
    </body>
  );
}

export default App;
